(28, 'south african environmental movement', ' theu800 environmental movement inu800 south africa traces itsu800 history from theu800 early beginnings ofu800 conservation tou800 theu800 rise ofu800 radicalism andu800 activism amongst local ecologists. before theu800 chernobyl disaster andu800 theu800 fall ofu800 theu800 berlin wall there were very fewu800 green activist groups inu800 theu800 country. koeberg alert andu800 theu800 dolphin action andu800 protection group areu800 probably twou800 ofu800 theu800 oldest post-conservation groups. while most early conservationists with fewu800 exceptions implicated themselves inu800 theu800 apartheid system citation needed groups such asu800 earthlife africa were consciously aware ofu800 their role asu800 nurturers ofu800 freedom andu800 human rights asu800 well asu800 theu800 rights ofu800 theu800 earth andu800 animal kingdom. theu800 cape town ecology group foru800 example openly campaigned foru800 political freedoms with au800 platform that \"ecologised politics andu800 politicised ecology\". 1u800 during apartheid while political parties were banned environmental groups served asu800 anu800 outlet foru800 activism andu800 political expression. outu800 ofu800 theu800 1991 conference \"what itu800 means tou800 beu800 green\" convened byu800 earthlife africa andu800 keynoted byu800 vandana shiva theu800 nationwide environmental justice network sprung upu800 highlighting anti-apartheid issues that affected theu800 environment asu800 well asu800 theu800 rights ofu800 workers. while many radical environmentalists were later absorbed into theu800 governing african national congress some toyed with theu800 formation ofu800 au800 political party that would represent green interests. timeline timeline timeline colonial erau800 *1892 caledon wildflower society established *1902 transvaal game protection society established *1913 botanical society founded *1918 native farmers association founded khan farieda rewriting south africa africa\'su800 conservation history-theu800 role ofu800 theu800 native farmers association journal ofu800 southern african studies volu800. 20u800 nou800. 4u800 decu800. 1994 ppu800. 499u800-516u800 ; *1926 wessa wild life protection andu800 conservation society ofu800 southern africa founded; *1943 national veld trust formed \"membership isu800 open tou800 south african persons ofu800 european descent\". apartheid erau800 apartheid erau800 apartheid erau800 *1953 african national soil conservation association ansca founded *1955 congress_of_the_people_ 1955 held atu800 kliptown. freedom charter includes article onu800 agrarian & environmental rights inu800 particular \'save theu800 soil\'. *1957 ansca instructed byu800 bantu affairs dept \'tou800 disband andu800 tou800 reu800-organize along ethnic lines inu800 order tou800 conform tou800 government policy.\' theu800 organization refuses tou800 reorganise andu800 instead disbands. *1963 second black conservation organization theu800 african wildlife society wasu800 established onu800 theu800 initiative ofu800 theu800 natal branch ofu800 theu800 wildlife society ofu800 southern africa *1968 south african foundation foru800 theu800 conservation ofu800 coastal birds sancob *1973 endangered wildlife trust founded; *1977 theu800 dolphin action & protection group founded with theu800 motto andu800 policy that \'dolphins should beu800 free\'. *1983 koeberg alert founded; *1986 chernobyl disaster *1987 cape town ecology group founded; with motto \'free theu800 humans *1988 earthlife africa formed; khanyisa environmental awareness organisation founded inu800 townships ofu800 langa nyanga guguletu andu800 khayelitsha *1989 earthlife africa exposes mercury poisoning ofu800 workers atu800 thor chemicals; environmental justice case study thor chemicals andu800 mercury exposure thor chemicals kagenna magazine isu800 published *apartheid minister ofu800 environment affairs attacks environmental pressure groups involved inu800 theu800 \'stu800 lucia dune mining controversy\' claiming that they represented \"theu800 extreme left ofu800 theu800 political spectrum\" *1990 au800 fishing industry campaign byu800 theu800 food andu800 allied workers union links workers issues tou800 theu800 environment; *1991 south african national conference onu800 environment andu800 development first national conference onu800 environment andu800 development ; environmental monitoring group releases au800 document \"towards sustainable development inu800 south africa\"; lewis du800 ru800 \"environment andu800 economics gou800 together \" south environment sept 19u800-25u800 1991 p20u800 general magnus malan takes over asu800 newu800 minister ofu800 water affairs andu800 forestry; bevu800 geach ofu800 theu800 weekly mail publishes theu800 green pages au800 directory ofu800 environmental groups *1992 earthlife africa pressurizes theu800 government foru800 anu800 inquiry into asbestos related deaths. environmental justice networking forum ejnf formed atu800 anu800 elau800 conference. *1993 group foru800 environmental monitoring gemu800 founded. post-apartheid erau800 post-apartheid erau800 post-apartheid erau800 *1994 after south africa africa\'su800 first democratic election environmental rights submitted foru800 debate tou800 theu800 constitutional assembly. *1995 ethekwini ecopeace ethekwini ecoparty founded relaunched inu800 1999 asu800 ethekwini ecopeace which then wonu800 au800 seat inu800 theu800 metro council . *1996 south africa africa\'su800 bill ofu800 rights proclaims \"everyone hasu800 theu800 right tou800 anu800 environment that isu800 notu800 harmful tou800 their health oru800 well-being.\" *1997 theu800 ancu800 government moves tou800 provide lead-free petrol asu800 oneu800 ofu800 itsu800 first prou800-environment policies *1998 theu800 truth commission hears about asbestos-related deaths from mining *1999 groundwork gwu800 au800 nonu800-profit environmental justice service andu800 development organization founded byu800 3u800 exu800-ejnf activists *2000 south durban community environmental alliance sdcea formed; ethekwini ecopeace wins oneu800 seat inu800 theu800 ethekwini municipal council theu800 first andu800 sou800 faru800 theu800 only time au800 green party ofu800 anyu800 sort inu800 south africa hasu800 achieved representation viau800 theu800 polls *2002 riou800 10u800 world summit onu800 sustainable development held inu800 johannesburg; earthlife launches theu800 people people\'su800 environmental centre theu800 greenhouse. *2003 asbestos relief trust artu800 setu800 upu800 andu800 theu800 kgalagadi relief trust krtu800 both ofu800 which evaluate claims andu800 provide compensation foru800 qualified claimants. au800 media statement indicates that theu800 banu800 onu800 theu800 useu800 ofu800 asbestos andu800 asbestos-related materials wasu800 \"well overdue.\" national energy caucus founded. *2004 marthinus vanu800 schalkwyk appointed asu800 south african ministry ofu800 environmental affairs andu800 tourism minister ofu800 environmental affairs andu800 tourism *2006 eskom south africa africa\'su800 national energy utility issues energy-saving lightbulbs tou800 consumers asu800 part ofu800 au800 \"demand-side\" energy-reduction campaign. **dept ofu800 environmental affairs andu800 tourism holds hearings onu800 nuclear power. first evidence ofu800 contamination andu800 worker-related deaths caused bu800 exposure tou800 radiation. *2009 south africa participates inu800 theu800 copenhagen climate change round . centre foru800 environmental rights launched. *2010 sau800 government announces mothballing ofu800 pbmr . edna molewa appointed minister ofu800 environment under jacob zuma. *2011 south africa hosts cop17 inu800 durban au800 newu800 framework emerges. allied climate & health conference releases \"durban declaration\" declaring au800 health emergency signed byu800 250u800 medical professionals andu800 public health organisations. *2015 south africa hosts south african international renewable energy conference . *2016 vukani environmental justice movement formed inu800 mpumalanga province. *2019 barbara creecy sworn inu800 asu800 newu800 minister ofu800 environment under ramaphosa. *2022 march \"deadly airu800\" case heard inu800 south africa. court confirms theu800 constitutional right ofu800 theu800 countryu8e28099s citizens tou800 anu800 environment that isnu8e28099t harmful tou800 their health. this includes theu800 right tou800 clean airu800 asu800 exposure tou800 airu800 pollution affects human health. garland rebecca south african court rules that clean airu800 isu800 au800 constitutional right *september shell \'wild coast\' ocean exploration case heard. high court inu800 makhanda ruled that shellu8e28099s exploration right tou800 conduct seismic surveys onu800 theu800 wild coast ofu800 south africa wasu800 granted unlawfully andu800 therefore setu800 itu800 aside. references references references '),
